import React, { useEffect, useState } from 'react'
import axios from 'axios'
import Navbar from './NavBar'
import Footer from './Footer'
import Select from 'react-select'
import '../styles/searchflight.css'
import { makeStyles } from '@material-ui/core/styles';
import Card from '@material-ui/core/Card';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import Button from '@material-ui/core/Button';
import Typography from '@material-ui/core/Typography';





function SearchFlight() {
    const [orgins, setorgins] = useState([])
    const [destinations, setdestinations] = useState([])
    const [orgin, setorgin] = useState('')
    const [destination, setdestination] = useState('')
    const [result, setresult] = useState([])

    useEffect(() => {
        depatureandArrivalOptions()
    }, [])

    async function depatureandArrivalOptions() {
        const res = await axios.get('http://localhost:8080/flight/viewFlight')
        const data = res.data

        const orginAirportOptions = data.map(flight => (
            {
                "value": flight.sourceAirport,
                "label": flight.sourceAirport
            }
        ))

        setorgins(orginAirportOptions)

        const destinationAirportOptions = data.map(flight => (
            {
                "value": flight.destinationAirport,
                "label": flight.destinationAirport
            }
        ))

        setdestinations(destinationAirportOptions)


    }

    const handleSearch = () => {
        const url = `http://localhost:8080/flight/searchFlightByDestinationandSource/${destination}/${orgin}`
        axios.get(url).then((response) => {
            setresult(response.data)
        })

    }

 
      const bull = <span className="bullet">•</span>;

    return (
        <div >
            <Navbar />
            <div style={{ color: "black" }} className="container row">
                <div className="col"><Select options={orgins} placeholder="From" onChange={(e) => { setorgin(e.value) }} /></div>
                <div className="col"><Select options={destinations} placeholder="To" onChange={(e) => { setdestination(e.value) }} /></div>
                <div className="col"><button style={{ backgroundColor: "lightblue", width: "350px" }} onClick={handleSearch}>Search</button></div>

                {
                    result.map((flight)=>{
                        return(
                            <Card className="root" variant="outlined">
                            <CardContent>
                                <Typography className="title" color="textSecondary" gutterBottom>
                                    {flight.flightName}
                                </Typography>
                                <Typography variant="h5" component="h2">
                                {flight.sourceAirport}  <i class="fas fa-plane"> </i>  {flight.destinationAirport}
                                </Typography>
                                <Typography className="pos" color="textSecondary">
                                    <div className="row">
                                    <div className="col"><b>Departs On:</b><br/>{flight.depatureDate}<br/>{flight.departureHour}:{flight.departureMinute}</div>
                                    <div className="col"><b>Arrives On:</b><br/>{flight.arrivalDate}<br/>{flight.arrivalHour}:{flight.arrivalMinute}</div>
                                    </div>
                                <br/>
                                
                                </Typography>
                                <Typography variant="body2" component="p">
                                    <em>Booking Charges:</em><b>₹{flight.price}</b>
                                    <br />
                                    
                                </Typography>
                            </CardContent>
                            <CardActions>
                                <Button size="small"> Book Now</Button>
                            </CardActions>
                        </Card>
                        )
                    })
                }
                




            </div>

            {/* <Footer/> */}

        </div>
    )
}

export default SearchFlight
